import React from "react";

import video from "../video/video-4.mp4";
import "./HeroSectionLogin.css";
import PopupButtonSignUp from "./PopupButtonSignUp";
import firebase from "firebase";
import { useHistory } from "react-router";

function HeroSectionLogin() {
  const history = useHistory();
  const [email, setEmail] = React.useState("");
  const [password, setPsaaword] = React.useState("");

  function onSubmit() {
    firebase
      .auth()
      .createUserWithEmailAndPassword(email, password)
      .then(() => {
        history.push("/");
      });
  }

  return (
    <div className="log-in-hero-container">
      <video src={video} autoPlay loop muted></video>
      <h1>Welcome back!</h1>
      <p>Let's get you intside.</p>
      <div className="login-areas">
        <form>
          <div
            type="button"
            name="btn-google-login"
            className="btn-google-login"
          >
            Google log in
          </div>
          <div
            type="button"
            name="btn-facebook-login"
            className="btn-facebook-login"
          >
            Facebook log in
          </div>
          <div className="login-email">
            <input
              className="login-input"
              name="email"
              type="email"
              placeholder="Email"
              value={email}
              onChange={(e) => {
                setEmail(e.target.value);
              }}
            ></input>
          </div>
          <div className="login-password">
            <input
              className="login-input"
              naem="password"
              type="password"
              placeholder="Password"
              valu={password}
              onChange={(e) => {
                setPsaaword(e.target.value);
              }}
            ></input>
          </div>
          <div
            type="button"
            name="btn-Native-login"
            className="btn-nativ-login"
            onClick={() => {
              console.log("login");
              onSubmit();
            }}
          >
            Log in
          </div>
          <PopupButtonSignUp />
        </form>
      </div>
    </div>
  );
}

export default HeroSectionLogin;
